import React, { useState } from 'react';

const StartCallPage = () => {
  const [selectedLanguage, setSelectedLanguage] = useState('');
  const [userName, setUserName] = useState('');

  const handleLanguageChange = (event) => {
    setSelectedLanguage(event.target.value);
  };

  const handleNameChange = (event) => {
    setUserName(event.target.value);
  };

  const handleStartCall = () => {
    // Додайте вашу логіку для початку дзвінка
    console.log('Start call with language:', selectedLanguage, 'and user name:', userName);
  };

  return (
    <div>
      <h1>Start Call Page</h1>

      <form>
        <label>
          Select Language:
          <select value={selectedLanguage} onChange={handleLanguageChange}>
            <option value="english">English</option>
            <option value="spanish">Spanish</option>
            <option value="french">French</option>
            {/* Додайте інші мови за необхідності */}
          </select>
        </label>

        <br />

        <label>
          Enter Your Name:
          <input type="text" value={userName} onChange={handleNameChange} />
        </label>

        <br />

        <button type="button" onClick={handleStartCall}>
          Start Call
        </button>
      </form>
    </div>
  );
};

export default StartCallPage;
